webpackJsonp([0xd67d5e3e9839],{405:function(a,e){a.exports={data:{site:{siteMetadata:{title:"Crazy Woman",subtitle:"Enlouqueça para encontrar a lucidez.",copyright:"© Todos os direitos reservados",menu:[{label:"Artigos",path:"/"},{label:"Sobre",path:"/sobre/"},{label:"Contato",path:"/contato/"}],author:{name:"Mariana Brito",facebook:"https://www.facebook.com/briitomari",twitter:"https://twitter.com/briitomari",instagram:"https://www.instagram.com/briitomari/",github:"https://github.com/BritoMari",rss:"#",email:"mariana.bsouza@hotmail.com"}}},markdownRemark:{id:"/Users/marianabrito/dev/crazywoman/src/pages/pages/2017-10-08---sobre/index.md absPath of file >>> MarkdownRemark",html:'<p>Mariana Brito é uma pessoa louca por isso o título “Crazy Woman” que saiu de casa aos 19 e com 20 se mudou para Curitiba, onde atualmente mora com sua namorada maravilinda e seus 3 filhos de quatro patas. </p>\n<p>Ama comer, séries(em especial Smallville, ela já assistiu Q-U-A-T-R-O vezes), comer, gatos, cachorros, comer, transar e dirigir!</p>\n<p>Costumava ter o cabelo quase na bunda(que não tem) e hoje não passa mais de um mês sem passar a zero nas laterais da cabeça, ela quer saber de tudo e mais um pouco, é indecisa até hoje em qual profissão seguir, tem quebrado a cabeça e se saído bem em programação web.</p>\n<p>Ela sonha em tornar o mundo melhor com pequenas atitudes, mas sabe que não depende apenas dela, por isso fez o blog para enlouquecer outras pessoas.</p>\n<p><img src="https://britomari.github.io/crazywoman/static/9333247ac833a28dd298c0e435374df7-71f9e.jpg" alt="Família Feliz"></p>',frontmatter:{title:"Sobre a louca que vos fala",date:null,description:null}}},pathContext:{slug:"/sobre"}}}});
